const Directory = ({} ) => 
{
       return (
           <div className="directory-menu">
                {
                    this.state.items.map(({id, ...otherItemProps})=>(
                        <MenuItem key={id} {...otherItemProps}/>
                    ))
                }
            </div>
        )
}
export default Directory;
